import React from 'react';
import {HeaderPag, FooterPag, NavMenu } from "../layout/index";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Views from '../views';
const Home = Views.Home();

function RoutesPag(){
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/" element={Home}/>
            </Routes>
        </BrowserRouter>
    );
};

export default function Pagina(){
    return(
        <React.StrictMode>
            <div>Hola</div>
            <HeaderPag/>
            <main>
                <RoutesPag/>
            </main>
            <FooterPag/>

        </React.StrictMode>
    )

}
